%plots image, mode=0 then normal imges, mode=1, then surf
% handles.boolwin determines wheter the window is ploted or not
function plotim(handles)

axes(handles.CanvasIR)
toplot = get(handles.CanvasIR,'Children'); %see if previous plot was image or surface
Z = double(handles.currentFrame);
if (~handles.mode)
    xl = xlim;
    yl = ylim;
    aux = strcmp(get(toplot,'Type'), 'surface');
    if (aux)
       actualizeRotate3d(handles,1) %disables it if it was in 3D mode
       imagesc(Z)
       xl = xlim;
       yl = ylim; 
    end
    imagesc(Z)
    xlim(xl) %plot but with the same view
    ylim(yl)
    
    if (strcmp(get(handles.CalculatePOD, 'Enable'),'on') && handles.boolwin) %if there is already a window defined
      drawWin(handles)
    end
  
else
   if (~strcmp(get(toplot,'Type'), 'surface'))
       actualizeRotate3d(handles,0)
       surf(Z); %change to surf
   end
   toplot = get(handles.CanvasIR,'Children'); %if not just update data, camera remains the same
   set(toplot,'XData',1:size(Z,2),...
   'YData',1:size(Z,1),...
   'ZData',Z,...
   'CData',Z,'Line','none');
    %set(gca,'YDir','reverse')
    
end

