% --- Executes on button press in DrawWindow.
function DrawWindow_Callback(hObject, eventdata, handles)
% hObject    handle to DrawWindow (see GCBO)
% eventdata  reserved - to be defined in a future version of MATLAB
% handles    structure with handles and user data (see GUIDATA)
%handles
%Configure or block buttons

handles.boolwin = 0;
plotim(handles)
%save status of btns and disables all
status = freezeprogram(handles);
exit = 0; %no problems yet

% Construct a questdlg with 3 options
choice = questdlg('How will you define the window? (by drawing, provide 2 points)', ...
	'Window definition', ...
	'Drawing','Coordinates','Cancel','Cancel');

% Handle response
switch choice
    case 'Coordinates'
        boundaries = size(handles.currentFrame);
        x = inputdlg({['Coordinate x 1st point (1 - ',num2str(boundaries(2)),' )'] ,...
            ['Coordinate y 1st point (1 - ',num2str(boundaries(1)),' )'] ,...
            ['Coordinate x 2nd point (1 - ',num2str(boundaries(2)),' )'] ,...
            ['Coordinate y 2nd point (1 - ',num2str(boundaries(1)),' )'] },...
              'Coordinates');
        if (isempty(x)) %clicked on Cancel option
            exit  = 1;
        else
           
           x = str2double(x)';
           for i = 1:length(x)
               currnum = x(i);
               if (currnum > boundaries(mod(i,2) + 1) || currnum < 1 || isnan(currnum) || imag(currnum)~= 0)
                   ed = errordlg('Invalid coordinates','Error coordinate');
                   set(ed, 'WindowStyle', 'modal');
                   uiwait(ed);
                   exit = 1;
                   break;
               end
           end
           if (~exit)
           Pos0 = x(1:2);
           Pos1 = x(3:4);
           Pos0  = plotpoint(Pos0,handles);
           Pos1 = plotpoint(Pos1,handles);end
        end
    case 'Drawing'
        AxesCanvas = handles.CanvasIR;
        i = 1;
        Pos = zeros(2,2); %two points, 4 coordinates
        while ( i <= 2 )     % avoids clicking the colorbar or other axes
            aux = round(ginput(1));
            if (isempty(aux)) %check if empty input
                ed = errordlg('Invalid key, no point marked, try again','Error');
                set(ed, 'WindowStyle', 'modal');
                uiwait(ed);
                axes(handles.CanvasIR) %reset canvas
                continue
            end
            Pos(i,1:2) = aux;
            currentAxis = gca;
            if (currentAxis ~= AxesCanvas) %error if click in another axes
                  ed = errordlg('Invalid Canvas, try again','Error');
                  set(ed, 'WindowStyle', 'modal');
                  uiwait(ed);
                  axes(handles.CanvasIR) %reset canvas
                continue
            end
            Pos(i,1:2)  = plotpoint(Pos(i,1:2),handles);
            i = i + 1;
        end
        Pos0 = Pos(1,1:2);
        Pos1 = Pos(2,1:2);
        
    otherwise
        exit = 1;

end


if (~exit)
    sizeWin = abs(Pos0 - Pos1);
    %Check for good window
    if (sizeWin(1) == 0 ||  sizeWin(2) == 0)
        ed = errordlg('Provide a valid window (not a line)','Window Definition Error');
        set(ed, 'WindowStyle', 'modal');
        uiwait(ed);
        exit = 1;
    end
end
if (exit)
    resumeprogram(handles,status);
    plotim(handles)
    if (isfield(handles,'window'))
        drawWin(handles);
    end
    return;
end


%See in which corner of rectangle window the first poit was drawn (4 cases)
% in order to correct that the initial point must be the upper left corner
dx = Pos1(1) - Pos0(1);
dy = Pos1(2) - Pos0(2);
if (dx > 0 && dy > 0 )
    Pos = Pos0;
elseif (dx < 0 && dy > 0 )
    Pos = [Pos1(1), Pos0(2)];
elseif (dx < 0 && dy < 0 )
    Pos = Pos1;
else
    Pos = [Pos0(1), Pos1(2)];
end


%window contains [ x0 y0; sizeinX-1 sizeinY-1; maxorderinX maxorderinY]
handles.window = [Pos; sizeWin; sizeWin]; 
%restore all       
resumeprogram(handles,status);

%configure gui
set(handles.CalculatePOD, 'Enable', 'on')
set(handles.WinOrderX, 'String', num2str( handles.window(3,1)  ))
set(handles.WinOrderY, 'String', num2str( handles.window(3,2)  ))
set(handles.WinOrderX, 'Enable', 'on')
set(handles.WinOrderY, 'Enable', 'on')

%draw window
drawWin(handles)
handles.boolwin = 1;

guidata(hObject, handles);

function drawWin(handles)
aux = handles.window;
Pos0 = aux(1,1:2);
Pos1 = aux(1,1:2) + aux(2,1:2);
hold on
%upper horizontal line
plot([Pos0(1) Pos1(1)] ,[Pos0(2),Pos0(2)],'-k')
%lower horizontal line
plot([Pos0(1) Pos1(1)] ,[Pos1(2),Pos1(2)],'-k')
%right vertical line
plot([Pos1(1) Pos1(1)] ,[Pos1(2),Pos0(2)],'-k')
%left vertical line
plot([Pos0(1) Pos0(1)] ,[Pos0(2),Pos1(2)],'-k')
hold off


function Coeffs = PODdecomp(mat,Mp,Np)
%Basis functions

    [M, N, frames] = size(mat);
    [Phi_m] = kernelLegendre(M-1,M);
    [Phi_n] = kernelLegendre(N-1,N);
    [Phi_m, ~] = qr(Phi_m');
    [Phi_n,~] = qr(Phi_n');
    Phi_m = Phi_m(1:end,1:(Mp+1))';
    Phi_n = Phi_n(1:end,1:(Np+1))';
    Coeffs =  zeros(1,frames);
    for frame = 1:frames
    %Coefficient
        Coeffmn = Phi_m*mat(:,:,frame)*Phi_n';
        if ( Mp < 3 || Np < 3)
            Coeffs(frame) = ( sum(sum(abs(Coeffmn(:,:)))) - abs(Coeffmn(1,1) ) )/(size(Coeffmn,1)*size(Coeffmn,2) - 1 );
        else
            Coeffs(frame) = (mean(abs(Coeffmn(3,:))) + mean(abs(Coeffmn(:,3))))/2;
        end
    end
    



% --- Executes on button press in CalculatePOD.
function CalculatePOD_Callback(hObject, eventdata, handles)
